gGq(){return"Politique de confidentialit\xe9 \u2013 Application ASConnect\n\n1) Identit\xe9 du responsable de traitement\nLes donn\xe9es collect\xe9es dans l\u2019application ASConnect sont trait\xe9es par FAST France, en qualit\xe9 de responsable de traitement.\nPour toute question relative \xe0 vos donn\xe9es ou \xe0 l\u2019exercice de vos droits, vous pouvez nous contacter \xe0 : contact@fastfrance.org.\n\n2) Finalit\xe9s des traitements\nLes traitements de donn\xe9es r\xe9alis\xe9s via l\u2019application poursuivent les finalit\xe9s suivantes :\n\u2022 Cr\xe9ation et gestion de votre compte utilisateur pour un acc\xe8s nominatif \xe0 l\u2019application ASConnect ;\n\u2022 Utilisation des fonctionnalit\xe9s de g\xe9olocalisation afin de visualiser :\n  o des points d\u2019int\xe9r\xeat li\xe9s au syndrome d\u2019Angelman,\n  o et/ou des profils de personnes concern\xe9es, selon diff\xe9rents crit\xe8res (distance g\xe9ographique, g\xe9notype, tranche d\u2019\xe2ge) ;\n\u2022 Am\xe9lioration du service et personnalisation de l\u2019exp\xe9rience utilisateur, incluant la possibilit\xe9 pour l\u2019utilisateur de choisir s\u2019il souhaite ou non afficher une photo, son nom ou son pr\xe9nom.\n\n3) Cat\xe9gories de donn\xe9es collect\xe9es\nLes donn\xe9es suivantes peuvent \xeatre collect\xe9es :\n\u2022 Donn\xe9es d\u2019identification :\n  o nom, pr\xe9nom, adresse e-mail, mot de passe, photo,\n  o question et r\xe9ponse secr\xe8te (en cas d\u2019oubli du mot de passe) ;\n\u2022 Donn\xe9es sensibles :\n  o g\xe9notype, localisation du t\xe9l\xe9phone (g\xe9olocalisation).\nLa base l\xe9gale de ces traitements repose sur le consentement explicite et \xe9clair\xe9 de l\u2019utilisateur.\n\n4) Dur\xe9e de conservation des donn\xe9es\nLes donn\xe9es sont conserv\xe9es pendant toute la dur\xe9e d\u2019utilisation du compte, puis supprim\xe9es dans un d\xe9lai maximum de 12 mois apr\xe8s la derni\xe8re activit\xe9.\nL\u2019utilisateur peut \xe0 tout moment exercer son droit \xe0 l\u2019oubli directement dans l\u2019application, via le menu :\nPolitique de confidentialit\xe9 \u2192 Droit \xe0 l\u2019oubli.\n\n5) Destinataires et h\xe9bergement des donn\xe9es\nLes donn\xe9es sont h\xe9berg\xe9es de mani\xe8re s\xe9curis\xe9e sur les serveurs de PythonAnywhere.\nLes donn\xe9es sont stock\xe9es dans l\u2019Union europ\xe9enne.\n(Pour plus d\u2019informations sur la politique de protection des donn\xe9es de l\u2019h\xe9bergeur, consultez https://www.pythonanywhere.com/privacy/.)\n\n6) Droits des utilisateurs\nConform\xe9ment au R\xe8glement (UE) 2016/679 (RGPD), les utilisateurs disposent des droits suivants :\n\u2022 Droit d\u2019acc\xe8s, de rectification et d\u2019effacement (\xab droit \xe0 l\u2019oubli \xbb) \u2014 directement via leur profil ou le menu Politique de confidentialit\xe9 \u2192 Droit \xe0 l\u2019oubli ;\n\u2022 Droit d\u2019opposition, de portabilit\xe9 et de limitation du traitement ;\n\u2022 Droit de retrait du consentement \xe0 tout moment.\nPour exercer ces droits (autres que le droit \xe0 l\u2019oubli accessible depuis l\u2019application), vous pouvez envoyer un e-mail \xe0 contact@fastfrance.org.\n\n7) S\xe9curit\xe9 et confidentialit\xe9\nToutes les donn\xe9es sont chiffr\xe9es lors du stockage et de la transmission.\nLes mots de passe sont hach\xe9s selon les bonnes pratiques de s\xe9curit\xe9, et toutes les communications avec le service se font via le protocole HTTPS.\n\n8) Consentement explicite\nL\u2019inscription \xe0 l\u2019application ASConnect requiert le consentement explicite et \xe9clair\xe9 de l\u2019utilisateur pour les traitements d\xe9crits \xe0 la section 2.\nL\u2019utilisateur peut retirer ce consentement \xe0 tout moment via les param\xe8tres de son compte ou par contact direct \xe0 contact@fastfrance.org."},
